.about-history__img {
  object-fit: cover;
  object-position: center;
  width: 100%;
  height: 100%;
  max-height: 1000px;
}

.about-history__img {
  max-width: 100%;
  min-width: 100%;
  height: auto;
}
.about-history__desc {
  line-height: 150%;
  letter-spacing: 0.9px; 
}
.qs_list.about-history__list {
  grid-gap: 90px;
}
.about-history__date {
  font-family: Gilroy;
  font-style: normal;
  font-weight: bold;
  font-size: 110px;
  line-height: 133px;
  text-align: right;
  color: #176abd;  
  display: block;
  margin-top: -108px;
  margin-right: -27px;
  @media (max-width: 600px)  {
    margin-right: -10px;
  }
}

.about-history__quote {
  padding: 50px;
  font: 700 25px $f_main;
  text-align: center;
}
